import React from 'react';
import { Link } from 'react-router-dom';

import { Container } from './styles';

import logo from '../../assets/images/logo.svg';

function Header() {
  return (
    <Container>
      <Link>
        <img src={logo} alt="RocketShoes" />
      </Link>
    </Container>
  );
}

export default Header;
